import ReactDOM from "react-dom";
import React, { Component } from "react";

export default class Column extends Component<{
  width?: number,
  children?: React.Node
}> {
  render() {
    return (
      <div className={"col" + (this.props.width ? "-" + this.props.width : "")}>
        {this.props.children}
      </div>
    );
  }
}
